def _get_grouper(obj, key=None, axis=0, level=None, sort=True, observed=False, mutated=False, validate=True):
    group_axis = obj._get_axis(axis)

    if level is not None:
        # check if MultiIndex
        if isinstance(group_axis, MultiIndex):
            if is_list_like(level) and len(level) == 1:
                level = level[0]

            if key is None and is_scalar(level):
                # Get the level values from group_axis
                key = group_axis.get_level_values(level)
                level = None
        else:
            if is_list_like(level):
                nlevels = len(level)
                if nlevels == 1:
                    level = level[0]
                elif nlevels == 0:
                    raise ValueError("No group keys passed!")
                else:
                    raise ValueError("multiple levels only valid with MultiIndex")

            if isinstance(level, str):
                if obj.index.name != level:
                    raise ValueError(
                        "level name {} is not the name of the index".format(level)
                    )
            elif level > 0 or level < -1:
                raise ValueError("level > 0 or level < -1 only valid with MultiIndex")

            if not isinstance(level, (tuple, list)):
                level = [level]

            key = group_axis

    if isinstance(key, Grouper):
        binner, grouper, obj = key._get_grouper(obj, validate=False)
        if key.key is None:
            return grouper, [], obj
        else:
            return grouper, {key.key}, obj
    elif isinstance(key, BaseGrouper):
        return key, [], obj
    elif isinstance(key, tuple):
        if len(key) == 1:
            key = list(key)
        else:
            is_any_unhashable = any(not is_hashable(k) for k in key)
            if is_any_unhashable or all(k not in obj and set(k).issubset(obj) for k in key):
                msg = (
                    "Interpreting tuple 'by' as a list of keys, rather than "
                    "a single key. Use 'by=[...]' instead of 'by=(...)'. In "
                    "the future, a tuple will always mean a single key."
                )
                warnings.warn(msg, FutureWarning, stacklevel=5)
                key = list(key)

    if not isinstance(key, list):
        keys = [key]
        match_axis_length = False
    else:
        keys = key
        match_axis_length = len(keys) == len(group_axis)

    any_callable = any(callable(g) or isinstance(g, dict) for g in keys)
    any_groupers = any(isinstance(g, Grouper) for g in keys)
    any_arraylike = any(
        isinstance(g, (list, tuple, Series, Index, np.ndarray)) for g in keys
    )

    if not any_callable and not any_arraylike and not any_groupers and match_axis_length and level is None:
        all_in_columns_index = all(g in obj.columns or g in obj.index.names for g in keys) if isinstance(obj, DataFrame) else all(g in obj.index.names for g in keys)
        if not all_in_columns_index:
            keys = [com.asarray_tuplesafe(keys)]

    if isinstance(level, (tuple, list)):
        if key is None:
            keys = [None] * len(level)
        levels = level
    else:
        levels = [level] * len(keys)

    groupings = []
    exclusions = []

    for i, (gpr, level) in enumerate(zip(keys, levels)):
        if callable(gpr) or isinstance(gpr, dict):
            in_axis, name, gpr = False, None, gpr
        else:
            if isinstance(obj, DataFrame):
                all_in_columns_index = [g in obj.columns for g in gpr] if isinstance(gpr, (list, tuple)) else gpr in obj.columns
            else:
                all_in_columns_index = gpr in obj.index

            if all_in_columns_index:
                if validate:
                    obj._check_label_or_level_ambiguity(gpr)
                in_axis, name, gpr = True, gpr, obj[gpr] if isinstance(gpr, (list, tuple)) else obj[gpr]
            else:
                in_axis, name, level, gpr = False, None, gpr, gpr

        if is_categorical_dtype(gpr) and len(gpr) != obj.shape[axis]:
            raise ValueError(
                (
                    "Length of grouper ({len_gpr}) and axis ({len_axis})"
                    " must be same length".format(
                        len_gpr=len(gpr), len_axis=obj.shape[axis]
                    )
                )
            )

        groupings.append(
            Grouping(
                group_axis,
                gpr,
                obj=obj,
                name=name,
                level=level,
                sort=sort,
                observed=observed,
                in_axis=in_axis,
            )
        )

    if len(groupings) == 0:
        raise ValueError("No group keys passed!")

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)
    return grouper, exclusions, obj
